def _css_button_with_icon(key: str, *, icon_b64: str | None, bg: str, fg: str = "white",
                          border: str = "1px solid rgba(255,255,255,0.18)",
                          radius: int = 14, height: int = 50,
                          pad_left: int = 56, font_size: int = 16,
                          shadow_css: str = "0 10px 24px rgba(0,0,0,.18)",
                          hover_bg: str | None = None, inline_icon: bool = False) -> None:
    """Style a Streamlit button using the wrapper class .st-key-<key>."""
    if not key:
        return
    hover_bg = hover_bg or bg

    icon_rule = ""
    if icon_b64:
        if inline_icon:
            icon_rule = f"""
.st-key-{key} button::before {{
  content: "";
  width: 24px;
  height: 24px;
  position: relative;
  left: 0;
  top: 0;
  transform: none;
  margin-right: 10px;
  background-image: url('data:image/png;base64,{icon_b64}');
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  opacity: 1;
}}
"""
        else:
            icon_rule = f"""
.st-key-{key} button::before {{
  content: "";
  width: 26px;
  height: 26px;
  position: absolute;
  left: 18px;
  top: 50%;
  transform: translateY(-50%);
  background-image: url('data:image/png;base64,{icon_b64}');
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  opacity: 1;
}}
"""

    st.markdown(f"""<style>
.st-key-{key} button {{
  position: relative;
  width: 100%;
  height: {height}px;
  border-radius: {radius}px !important;
  border: {border} !important;
  background: {bg} !important;
  color: {fg} !important;
  font-weight: 800 !important;
  font-size: {font_size}px !important;
  letter-spacing: .2px;
  box-shadow: {shadow_css} !important;
  padding-left: {pad_left}px !important;
  display: inline-flex !important;
  align-items: center !important;
  justify-content: center !important;
}}
.st-key-{key} button:hover {{
  background: {hover_bg} !important;
  filter: brightness(1.03);
}}
.st-key-{key} button:active {{
  transform: translateY(1px);
}}
{icon_rule}

</style>""", unsafe_allow_html=True)


