ICON_FILES: Dict[str, str] = {
    # "ip": "assets/icons/ip.png",
    # "dwdm": "assets/icons/dwdm.png",
    # "fibra": "assets/icons/fibra.png",
    # ...
}

def icon_img(category_key: str) -> Optional[str]:
    p = ICON_FILES.get(category_key)
    if not p:
        return None
    try:
        import os
        return p if os.path.exists(p) else None
    except Exception:
        return None

