def category_icon_inline_html(category_key: str, fallback_emoji: str) -> str:
    """Retorna HTML com cone (URL) para usar no ttulo da pgina.

    - Preferncia: arquivo local em ICON_FILES (caso exista)
    - Seno: URL do Flaticon (CATEGORY_ICON_URLS)
    - Seno: emoji
    """
    icon_path = icon_img(category_key)
    if icon_path:
        # Para arquivo local, o Streamlit no permite embutir fcil no HTML; exibimos via st.image.
        # Aqui retornamos vazio e deixamos o caller renderizar o st.image.
        return ""
    url = CATEGORY_ICON_URLS.get(category_key)
    if url:
        return (
            f'<span style="display:inline-flex;align-items:center;justify-content:center;'
            f'width:{160 if category_key=="viasat" else 32}px;'
            f'height:{44 if category_key=="viasat" else 32}px;'
            f'border-radius:{14 if category_key=="viasat" else 10}px;'
            f'background:{("#0B2A4A" if category_key=="viasat" else "transparent")};'
            f'padding:{("6px 10px" if category_key=="viasat" else "0")};'
            f'margin-right:10px;'
            f'box-shadow:{("0 10px 22px rgba(2,6,23,.16)" if category_key=="viasat" else "none")};">'
            f'<img src="{url}" style="width:{140 if category_key=="viasat" else 30}px;'
            f'height:{32 if category_key=="viasat" else 30}px;'
            f'object-fit:contain;'
            f'filter: drop-shadow(0 4px 10px rgba(0,0,0,.22));" />'
            f'</span>'
        )
    return f"<span style=\"margin-right:10px\">{fallback_emoji}</span>"

