def build_shift_handoff_text_global(tickets: List[Dict[str, Any]], meta: Dict[str, str]) -> str:
    """Texto padro Telebras (clean) para passagem de turno, baseado no turno selecionado."""
    dt = meta.get("data_turno", "-") or "-"
    turno = meta.get("turno", "-") or "-"
    resp = (meta.get("responsavel") or "").strip()

    header = [
        "TELEBRAS  NOC  PASSAGEM DE TURNO",
        f"Data: {dt} | Turno: {turno}" + (f" | Responsvel: {resp}" if resp else ""),
        ""
    ]

    if not tickets:
        return "\n".join(header + ["Sem registros de tickets para este turno."])

    # agrupa por categoria (respeita ordem do app)
    order = [k for _, k, _ in CATEGORIES if k != "dashboard"]
    label_by_key = {k: n for n, k, _ in CATEGORIES}
    buckets: Dict[str, List[Dict[str, Any]]] = {k: [] for k in order}
    for t in tickets:
        buckets.setdefault(t.get("category",""), []).append(t)

    def one_line(t: Dict[str, Any]) -> str:
        cat = t.get("category","").upper()
        tn = (t.get("ticket_number") or "-").strip()
        stt = (t.get("status") or "-").strip()
        crit = (t.get("criticidade") or "-").strip()

        extra = t.get("extra") or {}
        trecho = (extra.get("trecho") or extra.get("trecho_afetado") or "").strip()
        parceira = (extra.get("parceira") or extra.get("parceira_responsavel") or "").strip()

        obs = (t.get("observacoes") or t.get("descricao") or "").strip()
        if len(obs) > 120:
            obs = obs[:117].rstrip() + "..."

        parts = [f" [{cat}] {tn}", f"Status: {stt}", f"Crit: {crit}"]
        if trecho:
            parts.append(f"Trecho: {trecho}")
        if parceira:
            parts.append(f"Parceira: {parceira}")
        if obs:
            parts.append(f"Obs: {obs}")
        return " | ".join(parts)

    lines = header

    # Principais tickets (por categoria)
    lines.append("1) Tickets do turno (por categoria)")
    any_ticket = False
    for k in order:
        items = buckets.get(k, [])
        if not items:
            continue
        any_ticket = True
        lines.append(f"\n- {label_by_key.get(k, k).upper()} ({len(items)})")
        for t in items:
            lines.append(one_line(t))

    if not any_ticket:
        lines.append("Sem tickets.")

    # Pendncias
    pend = [t for t in tickets if str(t.get("pendencia") or "").strip()]
    lines.append("\n\n2) Pendncias para o prximo turno")
    if not pend:
        lines.append("Sem pendncias registradas.")
    else:
        for t in pend:
            cat = (t.get("category") or "").upper()
            tn = (t.get("ticket_number") or "-").strip()
            p = str(t.get("pendencia") or "").strip()
            if len(p) > 200:
                p = p[:197].rstrip() + "..."
            lines.append(f" [{cat}] {tn}  {p}")

    return "\n".join(lines)
def br_date(d: Any) -> str:
    if isinstance(d, (datetime, date)):
        return d.strftime("%d/%m/%Y")
    if isinstance(d, str):
        s = d.strip()
        for sep in ("-", "/"):
            parts = s.split(sep)
            if len(parts) == 3 and len(parts[0]) == 4:
                y, m, dd = parts
                if dd.isdigit() and m.isdigit() and y.isdigit():
                    return f"{dd.zfill(2)}/{m.zfill(2)}/{y}"
        return s
    return ""

def now_str() -> str:
    try:
        from zoneinfo import ZoneInfo
        return datetime.now(ZoneInfo("America/Sao_Paulo")).strftime("%d/%m/%Y - %H:%M")
    except Exception:
        return datetime.now().strftime("%d/%m/%Y - %H:%M")

def yn(label: str, value: str, key: str) -> str:
    opts = ["Sim", "No"]
    idx = 0 if (value or "Sim") == "Sim" else 1
    return st.radio(label, opts, index=idx, horizontal=True, key=key)

def badge_status_class(status: str) -> str:
    s_raw = (status or "Aberto").strip().lower()

    # Normalizao (aceita ingls e pt-br)
    if s_raw in ("open", "aberto"):
        return "badge-open"
    if s_raw in ("in progress", "inprogress", "em andamento", "andamento", "em_andamento"):
        return "badge-progress"
    if s_raw in ("closed", "fechado", "encerrado"):
        return "badge-closed"

    # fallback seguro
    return "badge-open"


def badge_crit_class(crit: str) -> str:
    c = (crit or "Mdia").lower()
    if "alta" in c:
        return "badge-alta"
    if "baixa" in c:
        return "badge-baixa"
    return "badge-media"


def ticket_crit_border_class(crit: str) -> str:
    c = (crit or "Mdia").lower()
    if "alta" in c:
        return "crit-alta"
    if "baixa" in c:
        return "crit-baixa"
    return "crit-media"


