@st.cache_resource(show_spinner=False)
def db() -> sqlite3.Connection:
    """SQLite connection cached for the session (stable + fast)."""
    conn = sqlite3.connect(DB_PATH, check_same_thread=False, timeout=30)
    conn.execute(
        """
        CREATE TABLE IF NOT EXISTS tickets (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            category TEXT NOT NULL,
            ticket_number TEXT NOT NULL,
            status TEXT NOT NULL,
            criticidade TEXT NOT NULL,
            responsavel TEXT,
            equipamento TEXT,
            id_estacao TEXT,
            descricao TEXT,
            acao_tomada TEXT,
            pendencia TEXT,
            criterios TEXT,
            politica TEXT,
            correlatos TEXT,
            observacoes TEXT,
            extra TEXT,
            created_at TEXT NOT NULL
        )
        """
    )

    # Backward-compatible migration: add column if old DB exists
    try:
        cols = [r[1] for r in conn.execute("PRAGMA table_info(tickets)").fetchall()]
        if "extra" not in cols:
            conn.execute("ALTER TABLE tickets ADD COLUMN extra TEXT")
            conn.commit()
    except Exception:
        pass

    conn.execute("CREATE INDEX IF NOT EXISTS idx_cat_created ON tickets(category, created_at)")
    conn.execute("CREATE UNIQUE INDEX IF NOT EXISTS idx_cat_ticket ON tickets(category, ticket_number)")
    conn.commit()
    return conn


# Compatibilidade: algumas verses do app chamavam `init_db()`.
# Aqui o `db()` j garante a criao/migrao das tabelas, ento
# `init_db()` apenas delega para ele.

def init_db() -> 'sqlite3.Connection':
    return db()

def fetch_counts(conn: sqlite3.Connection) -> Dict[str, int]:
    out = {k: 0 for _, k, _ in CATEGORIES if k != "dashboard"}
    rows = conn.execute("SELECT category, COUNT(*) FROM tickets GROUP BY category").fetchall()
    for cat, c in rows:
        out[cat] = int(c)
    return out


