def upsert_ticket(conn: sqlite3.Connection, payload: Dict[str, Any], ticket_id: Optional[int] = None) -> None:
    extra_json = json.dumps(payload.get("extra", {}) or {}, ensure_ascii=False)
    if ticket_id is None:
        conn.execute(
            """
            INSERT INTO tickets (
                category, ticket_number, status, criticidade, responsavel, equipamento, id_estacao,
                descricao, acao_tomada, pendencia, criterios, politica, correlatos, observacoes, extra, created_at
        ) VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?)
            """,
            (
                payload["category"],
                payload["ticket_number"],
                payload["status"],
                payload["criticidade"],
                payload.get("responsavel", ""),
                payload.get("equipamento", ""),
                payload.get("id_estacao", ""),
                payload.get("descricao", ""),
                payload.get("acao_tomada", ""),
                payload.get("pendencia", ""),
                payload.get("criterios", "Sim"),
                payload.get("politica", "Sim"),
                payload.get("correlatos", "Sim"),
                payload.get("observacoes", ""),
                extra_json,
                payload.get("created_at", now_str()),
        ),
        )
    else:
        conn.execute(
            """
            UPDATE tickets
            SET ticket_number=?, status=?, criticidade=?, responsavel=?, equipamento=?, id_estacao=?,
                descricao=?, acao_tomada=?, pendencia=?, criterios=?, politica=?, correlatos=?,
                observacoes=?, extra=?
            WHERE id=?
            """,
            (
                payload["ticket_number"],
                payload["status"],
                payload["criticidade"],
                payload.get("responsavel", ""),
                payload.get("equipamento", ""),
                payload.get("id_estacao", ""),
                payload.get("descricao", ""),
                payload.get("acao_tomada", ""),
                payload.get("pendencia", ""),
                payload.get("criterios", "Sim"),
                payload.get("politica", "Sim"),
                payload.get("correlatos", "Sim"),
                payload.get("observacoes", ""),
                extra_json,
                ticket_id,
        ),
        )
    conn.commit()

def delete_ticket(conn: sqlite3.Connection, ticket_id: int) -> None:
    conn.execute("DELETE FROM tickets WHERE id=?", (ticket_id,))
    conn.commit()

