def gerar_pdf_categoria(conn: sqlite3.Connection, category: str, titulo: str, meta: Dict[str, str]) -> bytes:
    styles = getSampleStyleSheet()
    logo_bytes = get_telebras_logo_bytes()

    # ---- PDF: estilos para evitar texto "tampando" (quebra de linha dentro das clulas)
    cell_style = styles["BodyText"].clone("cell_style")
    cell_style.fontName = "Helvetica"
    cell_style.fontSize = 9
    cell_style.leading = 11
    try:
        cell_style.wordWrap = "CJK"
    except Exception:
        pass

    key_style = styles["BodyText"].clone("key_style")
    key_style.fontName = "Helvetica-Bold"
    key_style.fontSize = 9
    key_style.leading = 11
    try:
        key_style.wordWrap = "CJK"
    except Exception:
        pass

    def _esc(s: Any) -> str:
        txt = "" if s is None else str(s)
        return (
            txt.replace("&", "&amp;")
            .replace("<", "&lt;")
            .replace(">", "&gt;")
            .replace("\n", "<br/>")
        )

    def P(txt: Any) -> Paragraph:
        return Paragraph(_esc(txt), cell_style)

    def K(txt: Any) -> Paragraph:
        return Paragraph(_esc(txt), key_style)
    buffer = BytesIO()
    doc = SimpleDocTemplate(buffer, pagesize=A4, rightMargin=36, leftMargin=36, topMargin=36, bottomMargin=36)

    elements: List[Any] = []

    # Cabealho institucional (logo + ttulo)
    # - Logo sem deformar (mantm proporo)
    # - Ttulo sem "TELEBRAS " (conforme solicitado)
    try:
        img = RLImage(BytesIO(logo_bytes))
        # Logo maior, mantendo proporo (evita ficar "espremida")
        # (A4 largura til ~523pt com margens atuais)
        max_w, max_h = 320, 60
        try:
            from PIL import Image as PILImage
            im = PILImage.open(BytesIO(logo_bytes))
            w, h = im.size
            if w and h:
                scale = min(max_w / float(w), max_h / float(h))
                img.drawWidth = float(w) * scale
                img.drawHeight = float(h) * scale
            else:
                img.drawWidth, img.drawHeight = max_w, max_h
        except Exception:
            img.drawWidth, img.drawHeight = max_w, max_h
        img.hAlign = "LEFT"

        # Ajusta larguras para acomodar a logo maior sem quebrar o layout
        header_tbl = Table([[img, Paragraph("Checklist Operacional", styles["Title"])]], colWidths=[320, 203])
        header_tbl.setStyle(TableStyle([
            ("VALIGN", (0,0), (-1,-1), "MIDDLE"),
            ("LEFTPADDING", (0,0), (-1,-1), 0),
            ("RIGHTPADDING", (0,0), (-1,-1), 0),
            ("TOPPADDING", (0,0), (-1,-1), 0),
            ("BOTTOMPADDING", (0,0), (-1,-1), 0),
        ]))
        elements.append(header_tbl)
    except Exception:
        elements.append(Paragraph("Checklist Operacional", styles["Title"]))
    elements.append(Paragraph(f"<b>{titulo}</b>", styles["Heading2"]))
    elements.append(Spacer(1, 10))


    # Busca tickets antes para permitir fallback do responsvel no cabealho do PDF
    tickets = fetch_tickets(conn, category)

    meta_resp = (meta.get("responsavel") or "").strip()

    meta_rows = [
        [K("Data do turno"), P(meta.get("data_turno", "-"))],
        [K("Turno"), P(meta.get("turno", "-"))],
        [K("Lder de equipe"), P(meta_resp or "-")],
        [K("Gerado em"), P(now_str())],
    ]
    table = Table(meta_rows, colWidths=[140, 360])
    table.setStyle(
        TableStyle(
            [
                ("BACKGROUND", (0, 0), (-1, 0), colors.whitesmoke),
                ("BOX", (0, 0), (-1, -1), 0.6, colors.lightgrey),
                ("INNERGRID", (0, 0), (-1, -1), 0.25, colors.lightgrey),
                ("FONTNAME", (0, 0), (-1, -1), "Helvetica"),
                ("FONTSIZE", (0, 0), (-1, -1), 10),
                ("VALIGN", (0, 0), (-1, -1), "TOP"),
                ("LEFTPADDING", (0, 0), (-1, -1), 6),
                ("RIGHTPADDING", (0, 0), (-1, -1), 6),
                ("TOPPADDING", (0, 0), (-1, -1), 4),
                ("BOTTOMPADDING", (0, 0), (-1, -1), 4),
                ("WORDWRAP", (0, 0), (-1, -1), "CJK"),
            ]
        )
    )
    elements.append(table)
    elements.append(Spacer(1, 14))

    if not tickets:
        elements.append(Paragraph("Nenhum ticket registrado para esta categoria.", styles["Normal"]))
        doc.build(elements)
        return buffer.getvalue()

    elements.append(Paragraph(f"<b>Total:</b> {len(tickets)} ticket(s)", styles["Normal"]))
    elements.append(Spacer(1, 10))

    for t in tickets:
        extra = t.get("extra") or {}

        # Criticidade: em categorias enxutas (ex.: MASSIVOS) costuma vir no extra
        display_crit = (str(extra.get("criticidade") or "").strip() or t.get("criticidade", "Mdia"))

        elements.append(
            Paragraph(
                f"<b>Ticket:</b> {t['ticket_number']} | "
                f"<b>Status:</b> {t.get('status','Aberto')} | "
                f"<b>Criticidade:</b> {display_crit}",
                styles["Heading3"],
            )
        )
        elements.append(Spacer(1, 6))

        # Responsvel do ticket (algumas verses salvam no extra)
        ticket_resp = (t.get("responsavel") or "").strip() or str(extra.get("responsavel") or "").strip() or "-"

        # Campos especficos da categoria (somente os definidos no schema)
        extra_rows: List[List[str]] = []
        for field in CATEGORY_EXTRA_FIELDS.get(category, []):
            fkey = field.get("key")
            flabel = field.get("label", fkey)
            if not fkey:
                continue
            # Evita duplicar o responsvel (j mostramos acima)
            if fkey in ("responsavel",):
                continue
            val = extra.get(fkey, "")
            if isinstance(val, (dict, list)):
                continue
            val_str = str(val).strip()
            if val_str:
                extra_rows.append([str(flabel), val_str])

        # Categorias enxutas: no PDF s entra o que pertence ao schema da categoria (sem campos genricos)
        SIMPLE_CATS = {"fibra", "gateway", "viasat", "servicos", "massivos"}

        # Converte em Paragraph para quebrar linha corretamente e evitar sobreposio
        data: List[List[Any]] = []
        # Evita duplicidade: se a categoria j possui "Analista", no repetir "Responsvel" no ticket
        has_analista = any(str(k).strip().lower() == "analista" for k, _v in extra_rows) or bool((t.get("extra") or {}).get("analista")) or bool(t.get("analista"))
        if not has_analista:
            data.append([K("Responsvel"), P(ticket_resp)])
        data += [[K(k), P(v)] for k, v in extra_rows]

        if category not in SIMPLE_CATS:
            data += [
                [K("Equipamento"), P(t.get("equipamento") or "-")],
                [K("ID Estao"), P(t.get("id_estacao") or "-")],
                [K("Descrio"), P(t.get("descricao") or "-")],
                [K("Ao tomada"), P(t.get("acao_tomada") or "-")],
                [K("Pendncia"), P(t.get("pendencia") or "-")],
                [K("Critrios atendidos"), P(t.get("criterios", "Sim"))],
                [K("Poltica alinhada"), P(t.get("politica", "Sim"))],
                [K("Correlatos/Vinculao"), P(t.get("correlatos", "Sim"))],
                [K("Observaes"), P(t.get("observacoes") or "-")],
            ]

        data += [[K("Criado em"), P(t.get("created_at", "-"))]]
        tbl = Table(data, colWidths=[140, 360])
        tbl.setStyle(
            TableStyle(
                [
                    ("BACKGROUND", (0, 0), (-1, 0), colors.whitesmoke),
                    ("BOX", (0, 0), (-1, -1), 0.6, colors.lightgrey),
                    ("INNERGRID", (0, 0), (-1, -1), 0.25, colors.lightgrey),
                    ("FONTNAME", (0, 0), (-1, -1), "Helvetica"),
                    ("FONTSIZE", (0, 0), (-1, -1), 9),
                    ("VALIGN", (0, 0), (-1, -1), "TOP"),
                    ("LEFTPADDING", (0, 0), (-1, -1), 6),
                    ("RIGHTPADDING", (0, 0), (-1, -1), 6),
                    ("TOPPADDING", (0, 0), (-1, -1), 4),
                    ("BOTTOMPADDING", (0, 0), (-1, -1), 4),
                    ("WORDWRAP", (0, 0), (-1, -1), "CJK"),
                ]
        )
        )
        elements.append(tbl)
        elements.append(Spacer(1, 14))

    doc.build(elements)
    return buffer.getvalue()

