def render_dashboard():
    conn = init_db()

    categories = [key for _, key, _ in CATEGORIES if key != "dashboard"]
    counts = get_counts_by_category(conn)

    # Header
    st.markdown(
        """
        <div class="dash-hero">
          <div class="dash-hero-left">
            <div class="dash-kicker">TELEBRAS  NOC</div>
            <div class="dash-title">Dashboard Operacional</div>
          </div>
        </div>
        """,
        unsafe_allow_html=True,
    )

    # KPI cards (grid)
    kpi_cards = []
    for k in categories:
        label = next((name for name, kk, _ in CATEGORIES if kk == k), k.upper())
        num = int(counts.get(k, 0) or 0)
        kpi_cards.append(
            textwrap.dedent(
                f"""<div class="kpi-card">
  <div class="kpi-num">{num}</div>
  <div class="kpi-label">{label}</div>
</div>
"""
            )
        )
    st.markdown('<div class="kpi-grid">' + "".join(kpi_cards) + "</div>", unsafe_allow_html=True)


    # --- Trechos com reincidncia (para destaque de trecho crtico) ---
    trecho_counts = {}
    try:
        for (extra_txt,) in conn.execute("SELECT extra FROM tickets WHERE extra IS NOT NULL AND TRIM(extra) != ''").fetchall():
            try:
                extra = json.loads(extra_txt) if isinstance(extra_txt, str) else {}
            except Exception:
                extra = {}
            if isinstance(extra, dict):
                trecho = (extra.get("trecho") or "").strip()
                if trecho:
                    trecho_norm = " ".join(trecho.replace("", "<>").replace("", "-").split())
                    trecho_counts[trecho_norm] = trecho_counts.get(trecho_norm, 0) + 1
    except Exception:
        trecho_counts = {}

    top_trechos = sorted(trecho_counts.items(), key=lambda x: (-x[1], x[0]))[:5]
    top_trecho, top_trecho_count = (top_trechos[0] if top_trechos else ("", 0))
    trecho_critico = bool(top_trecho and top_trecho_count >= 3)

    # Destaque visual do trecho com maior reincidncia (quando aplicvel)
    if top_trecho:
        st.markdown(
            f'''
            <div class="trecho-crit-card">
              <div class="trecho-crit-title">Trecho com maior reincidncia</div>
              <div class="trecho-crit-sub">
                <span class="trecho-crit-badge"> {top_trecho_count} ocorrncia(s)</span>
                &nbsp;&nbsp;<b>{top_trecho}</b>
                {'<span style="margin-left:10px; color:#b91c1c; font-weight:800;"> Trecho crtico</span>' if trecho_critico else ''}
              </div>
            </div>
            ''',
            unsafe_allow_html=True
        )


    # Dados para grficos
    labels = [next((name for name, kk, _ in CATEGORIES if kk == k), k.upper()) for k in categories]
    values = [int(counts.get(k, 0) or 0) for k in categories]
    total = sum(values)


    palette = ["#0B63B3", "#00AEEF", "#2E7DFF", "#6B5BFF", "#00C2A8", "#FFB300", "#FF6B6B", "#7A8CA5"]

    df_cat = pd.DataFrame({"Categoria": labels, "Tickets": values})
    df_cat["Categoria"] = pd.Categorical(df_cat["Categoria"], categories=labels, ordered=True)

    # Ordena e calcula % com denominador seguro
    df_cat_sorted = df_cat.sort_values("Tickets", ascending=False).reset_index(drop=True)
    denom = total if total > 0 else 1
    df_cat_sorted["Percentual"] = (df_cat_sorted["Tickets"] / denom) * 100

    color_scale = alt.Scale(range=palette[: max(1, len(df_cat_sorted))])

    # Grfico 1: Colunas (vertical)
    tickets_col_chart = (
        alt.Chart(df_cat_sorted)
        .mark_bar(cornerRadiusTopLeft=10, cornerRadiusTopRight=10)
        .encode(
            x=alt.X("Categoria:N", sort=None, axis=alt.Axis(labelAngle=0, labelFontSize=12, labelColor="#334155")),
            y=alt.Y("Tickets:Q", axis=alt.Axis(title=None, grid=True, labels=False, ticks=False, domain=False)),
            color=alt.Color("Categoria:N", scale=color_scale, legend=None),
            tooltip=[alt.Tooltip("Categoria:N"), alt.Tooltip("Tickets:Q")],
        )
        .properties(height=260)
        .configure_view(strokeOpacity=0)
    )

    # Grfico 2: Barras (horizontal)
    bar_base = (
        alt.Chart(df_cat_sorted)
        .mark_bar(cornerRadius=10)
        .encode(
            y=alt.Y("Categoria:N", sort="-x", axis=alt.Axis(labelFontSize=12, labelColor="#334155")),
            x=alt.X("Tickets:Q", axis=alt.Axis(title=None, grid=True, labels=False, ticks=False, domain=False)),
            color=alt.Color("Categoria:N", scale=color_scale, legend=None),
            tooltip=[alt.Tooltip("Categoria:N"), alt.Tooltip("Tickets:Q")],
        )
        .properties(height=260)
    )
    bar_text = (
        alt.Chart(df_cat_sorted)
        .mark_text(align="left", baseline="middle", dx=6, fontSize=12, color="#0F172A", font="Inter")
        .encode(y=alt.Y("Categoria:N", sort="-x"), x="Tickets:Q", text="Tickets:Q")
    )
    tickets_bar_chart = (bar_base + bar_text).configure_view(strokeOpacity=0)

    # Donut (Distribuio Percentual)
    if total == 0:
        df_donut = pd.DataFrame({"Categoria": ["Sem tickets"], "Tickets": [1]})
        donut_total_text = "0"
        donut_colors = ["#D7E6F7"]
        donut_legend = None
    else:
        df_donut = df_cat_sorted.copy()
        donut_total_text = str(total)
        donut_colors = palette[: max(1, len(df_donut))]
        donut_legend = alt.Legend(orient="right", title=None, labelFontSize=12, labelColor="#334155", symbolType="circle")

    donut_base = (
        alt.Chart(df_donut)
        .mark_arc(innerRadius=92, outerRadius=128, cornerRadius=10)
        .encode(
            theta=alt.Theta("Tickets:Q"),
            color=alt.Color("Categoria:N", scale=alt.Scale(range=donut_colors), legend=donut_legend),
            tooltip=[alt.Tooltip("Categoria:N"), alt.Tooltip("Tickets:Q")],
        )
        .properties(width=280, height=280)
    )
    donut_text = (
        alt.Chart(pd.DataFrame({"text": [donut_total_text]}))
        .mark_text(font="Inter", fontSize=44, fontWeight=800, color="#0F172A")
        .encode(text="text:N")
        .properties(width=280, height=280)
    )
    donut_sub = (
        alt.Chart(pd.DataFrame({"text": ["TICKETS"]}))
        .mark_text(font="Inter", fontSize=12, fontWeight=700, color="#64748B", dy=36)
        .encode(text="text:N")
        .properties(width=280, height=280)
    )
    donut = alt.layer(donut_base, donut_text, donut_sub).resolve_scale(color="independent").configure_view(strokeOpacity=0)

    # Layout: 2 cards grandes lado a lado
    left, right = st.columns([1, 1], gap="large")

    with left:
        with st.container(border=True):
            st.markdown("#### Tickets por Categoria")
            tab_col, tab_bar = st.tabs(["Colunas", "Barras"])
            with tab_col:
                st.altair_chart(tickets_col_chart, use_container_width=True)
            with tab_bar:
                st.altair_chart(tickets_bar_chart, use_container_width=True)

    with right:
        with st.container(border=True):
            st.markdown("#### Distribuio Percentual")
            st.altair_chart(donut, use_container_width=True)


    if top_trechos:
        with st.expander("Ranking de trechos (reincidncia)", expanded=False):
            for trecho, cnt in top_trechos:
                badge = "" if (trecho == top_trecho and trecho_critico) else ("" if trecho == top_trecho else "")
                st.markdown(f"**{badge} {trecho}**  {cnt} ocorrncia(s)")
