    def render_extra_fields(category: str, defaults_extra: Dict[str, Any]) -> Dict[str, Any]:
        extra_schema = CATEGORY_EXTRA_FIELDS.get(category, [])
        extra_out: Dict[str, Any] = {}
        if not extra_schema:
            return extra_out

        # Evita duplicidade do campo de nmero do ticket:
        # - o nmero do ticket j  capturado no campo principal do formulrio (ticket_number)
        # - algumas categorias podem ter, por engano, o mesmo campo dentro de "Campos especficos"
        DUPLICATE_KEYS = {"ticket_number", "numero_ticket", "numero_do_ticket", "num_ticket"}

        st.markdown("### Campos especficos")
        ncols = 2 if category in ("viasat", "massivos") else 3
        cols = st.columns(ncols, gap="large")

        for i, field in enumerate(extra_schema):
            fkey = field["key"]
            if fkey in DUPLICATE_KEYS:
                continue
            flabel = field["label"]
            ftype = field.get("type", "text")
            ph = field.get("placeholder", "")
            options = field.get("options", [])
            val = (defaults_extra or {}).get(fkey, "")
            widget_key = f"{category}__extra__{fkey}__{st.session_state.get('editing_id') or 'new'}"

            # textarea sempre em largura total para melhor enquadramento
            if ftype == "textarea":
                extra_out[fkey] = st.text_area(flabel, value=str(val or ""), height=110, placeholder=ph, key=widget_key)
                continue

            col = cols[i % ncols]
            with col:
                if ftype == "text":
                    extra_out[fkey] = st.text_input(flabel, value=str(val or ""), placeholder=ph, key=widget_key)
                elif ftype == "number":
                    try:
                        extra_out[fkey] = st.number_input(flabel, value=float(val) if val not in ("", None) else 0.0, key=widget_key)
                    except Exception:
                        extra_out[fkey] = st.number_input(flabel, value=0.0, key=widget_key)
                elif ftype == "select":
                    if options:
                        try:
                            idx = options.index(val) if val in options else 0
                        except Exception:
                            idx = 0
                        extra_out[fkey] = st.selectbox(flabel, options, index=idx, key=widget_key)
                    else:
                        extra_out[fkey] = st.text_input(flabel, value=str(val or ""), placeholder=ph, key=widget_key)
                elif ftype == "radio":
                    if options:
                        try:
                            idx = options.index(val) if val in options else 0
                        except Exception:
                            idx = 0
                        extra_out[fkey] = st.radio(flabel, options, index=idx, horizontal=True, key=widget_key)
                    else:
                        extra_out[fkey] = st.text_input(flabel, value=str(val or ""), placeholder=ph, key=widget_key)
                else:
                    extra_out[fkey] = st.text_input(flabel, value=str(val or ""), placeholder=ph, key=widget_key)
        # normaliza: remove vazios
        extra_out = {k: v for k, v in extra_out.items() if str(v).strip() != ""}
        return extra_out

